  [],\n\t\"revision_timestamp\": \"2015-06-17T01:56:21.199238\",\n\t\"name\": \"summary-report-on-bristol-bay-murre-mortality\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"At least 86,000 common murres died in Bristol
  Bay, Alaska during a brief period in late April of this year. Evidence suggests
  that it was a catastrophic event of nature. The murres, apparently still weakened
  after wintering in the Bering Sea, probably died from a combination of starvation
  and exhaustion which was aggravated by a severe storm that prevented them from feeding
  during a critical few days.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
